This species has been reported on
Bradycellus
and
Trichocellus
(Col. Carabidae ) from many countries in Europe : France ( Balazuc 1974a ), Poland ( Majewski 1981 ), Russia , Finland ( Huldén 1983 ), Spain (
Balazuc et al. 1983
), United Kingdom , Italy , Belgium , Norway , Germany , Sweden ( Huldén 1985 ), Czech Republic ( Rossi & Máca 2006 ), Denmark ( Høier 2009 ), Switzerland ( Hoess & Senn-Irlet 2009 ), Slovakia (
Rossi et al. 2010
), the Netherlands (
Haelewaters et al. 2012
), and Bulgaria (
Rossi et al. 2019a
). Also from Madeira ( Huldén 1985 ) and Mexico (
Santamaria et al. 1991
).

